77339	44	5769	0	sql	0.00	-- Mise à jour des old de ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.oldeb à partir de\r\n-- ${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.oldeb\r\n-- sur la  base d'une jointure commune/section/parcelle\r\nUPDATE ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.oldeb SET\r\n\tgeometrie = oldeb_ref.geometrie,\r\n\tactif = true\r\nFROM\r\n(SELECT\r\n\tDISTINCT ON(com.id,o.section,o.numero)\r\n\tST_Multi(o.geometrie) AS geometrie, \r\n\to.section, \r\n\to.numero::text AS parcelle, \r\n\tcom.id AS commune\r\nFROM\r\n\t${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.oldeb o\r\n\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune com ON(com.insee = lpad(o.numero_insee::character varying,5,'0'))\r\nWHERE\r\n\to.etatobjet = 'REF') AS oldeb_ref\r\n\r\nWHERE\r\n\toldeb_ref.commune = oldeb.commune\r\n\tAND oldeb_ref.section = oldeb.section\r\n\tAND oldeb_ref.parcelle = oldeb.parcelle;\r\n\r\n-- Désactivation des old de ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.oldeb qui ne sont plus\r\n-- dans ${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.oldeb\r\n-- sur la  base d'une jointure commune/section/parcelle\r\nUPDATE ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.oldeb SET\r\n\tactif = false\r\nWHERE\r\n\tid IN(\r\n\tSELECT\r\n\t\toldeb.id\r\n\tFROM\r\n\t\t${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.oldeb\r\n\tLEFT JOIN (SELECT\r\n\t\tDISTINCT ON(com.id,o.section,o.numero)\r\n\t\tST_Multi(o.geometrie) AS geometrie, \r\n\t\to.section, \r\n\t\to.numero::text AS parcelle, \r\n\t\tcom.id AS commune\r\n\tFROM\r\n\t\t${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.oldeb o\r\n\t\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune com ON(com.insee = lpad(o.numero_insee::character varying,5,'0'))\r\n\tWHERE\r\n\t\to.etatobjet = 'REF') AS oldeb_ref ON (oldeb_ref.commune = oldeb.commune AND oldeb_ref.section = oldeb.section AND oldeb_ref.parcelle = oldeb.parcelle)\r\n\tWHERE\r\n\t\toldeb_ref IS NULL);\r\n\t\t\r\n-- Insertion des nouvelles old dans ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.oldeb\r\n-- sur la  base d'une jointure commune/section/parcelle\t\t\r\nINSERT INTO ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.oldeb (\r\n\tgeometrie,\r\n\tsection,\r\n\tparcelle, \r\n\tcommune\r\n)\r\nSELECT\r\n\toref.geometrie,\r\n\toref.section,\r\n\toref.parcelle,\r\n\toref.commune\r\nFROM\r\n(SELECT\r\n\tDISTINCT ON(com.id,o.section,o.numero)\r\n\tST_Multi(o.geometrie) AS geometrie, \r\n\to.section, \r\n\to.numero::text AS parcelle, \r\n\tcom.id AS commune\r\nFROM\r\n\t${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.oldeb o\r\n\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune com ON(com.insee = lpad(o.numero_insee::character varying,5,'0'))\r\nWHERE\r\n\to.etatobjet = 'REF'\r\n\tAND o.geometrie IS NOT NULL\r\n\tAND o.section IS NOT NULL\r\n\tAND o.numero::text IS NOT NULL\r\n) AS oref\r\nLEFT JOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.oldeb ON (oldeb.commune = oref.commune AND oldeb.section = oref.section AND oldeb.parcelle = oref.parcelle)\r\nWHERE\r\n\toldeb.commune IS NULL;\r\n
