87963	16	6556	0	sql	0.00	-- * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * \r\n-- * Suppression  pistes de sous type "ARCHIVE"\r\n-- * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * \r\n-- la colonne sous_type n'a pas été reprise lors du passage de piste vers dfci_piste\n--DELETE FROM ${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.dfci_piste WHERE sous_type = 'ARCHIVE';\r\n\r\n-- * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * \r\n-- * Affectation des communes aux tronçons de routes et de pistes si non renseigné\r\n-- * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * \r\n\r\n-- Affectation des codes insee et des nom de commune aux tronçons de piste si insee inconnu\r\nUPDATE ${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.dfci_piste p SET numero_insee = ac.numero_insee, commune = ac.commune FROM\r\n(SELECT\r\n\tDISTINCT ON(p.gc_key)\r\n\tp.gc_key,\r\n\tc.insee::integer AS numero_insee,\r\n\tc.nom AS commune\r\nFROM\r\n\t(SELECT gc_key,geometrie FROM ${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.dfci_piste WHERE st_isvalid(geometrie) AND (numero_insee IS NULL OR numero_insee NOT IN(SELECT insee::integer FROM ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune))) p\r\n\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune c ON(p.geometrie && c.geometrie AND St_Intersects(p.geometrie,c.geometrie))\r\nORDER BY\r\n\tp.gc_key,\r\n\tSt_length(St_Intersection(p.geometrie,c.geometrie)) DESC) AS ac\r\nWHERE\r\n\tp.gc_key = ac.gc_key;\r\n\r\n-- Affectation des codes insee et des nom de commune aux tronçons de routes si insee inconnu\r\nUPDATE ${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.res_route r SET numero_insee = ac.numero_insee, commune = ac.commune FROM\r\n(SELECT\r\n\tDISTINCT ON(r.gc_key)\r\n\tr.gc_key,\r\n\tc.insee::integer AS numero_insee,\r\n\tc.nom AS commune\r\nFROM\r\n\t(SELECT gc_key,geometrie FROM ${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.res_route WHERE st_isvalid(geometrie) AND (numero_insee IS NULL OR numero_insee NOT IN(SELECT insee::integer FROM ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune))) r\r\n\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune c ON(r.geometrie && c.geometrie AND St_Intersects(r.geometrie,c.geometrie))\r\nORDER BY\r\n\tr.gc_key,\r\n\tSt_length(St_Intersection(r.geometrie,c.geometrie)) DESC) AS ac\r\nWHERE\r\n\tr.gc_key = ac.gc_key;\r\n\r\n\r\n\r\n-- * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * \r\n-- * Consolidation des voies à partir des tronçons de routes et des tronçons de pistes\r\n-- * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * * \r\n\r\nTRUNCATE ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.voie;\r\n\r\n-- Voies issus des tronçons de routes\r\nINSERT INTO ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.voie (\r\n\tgeometrie,\r\n\tmot_classant,\r\n\tnom,\r\n\tsource,\r\n\tcommune\r\n) SELECT\r\n\tst_union(st_multi(geometrie)),\r\n\tCOALESCE(mot_classant,''),\r\n\tCOALESCE(nom,''),\r\n\t'ROUTE'::character varying AS source,\r\n\tcommune\r\nFROM\r\n(SELECT DISTINCT ON(r.geometrie)\r\n\tr.geometrie,\r\n\tr.mot_classant,\r\n\ttranslate(r.com_nme, 'ÀÁÂÃÄÅÇÈÉÊËÌÍÎÏÒÓÔÕÖÙÚÛÜ', 'AAAAAACEEEEIIIIOOOOOUUUU') AS nom,\r\n\tc.id AS commune\r\nFROM\r\n\t${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.res_route r\r\n\t--JOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune c ON r.commune = c.nom\r\n\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune c ON r.numero_insee::text = c.insee\r\nWHERE\r\n\tst_isvalid(r.geometrie)\r\n\tAND st_geometrytype(r.geometrie) = 'ST_LineString'\r\n\r\n) AS troncons_uniques\r\nGROUP BY\r\n\tmot_classant,\r\n\tnom,\r\n\tcommune;\r\n\r\n-- Voies issus des tronçons de pistes\r\nINSERT INTO ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.voie (\r\n\tgeometrie,\r\n\tmot_classant,\r\n\tnom,\r\n\tsource,\r\n\tcommune\r\n) SELECT\r\n\tst_union(st_multi(geometrie)),\r\n\t''::character varying AS mot_classant,\r\n\tCOALESCE(translate(nom, 'ÀÁÂÃÄÅÇÈÉÊËÌÍÎÏÒÓÔÕÖÙÚÛÜ', 'AAAAAACEEEEIIIIOOOOOUUUU'),''),\r\n\t'PISTE'::character varying AS source,\r\n\tcommune\r\nFROM\r\n(SELECT DISTINCT ON(p.geometrie)\r\n\tp.geometrie,\r\n\tp.com_nme AS nom,\r\n\tc.id AS commune\r\nFROM\r\n\t${PDI_POSTGRESQL_NOM_SCHEMA_REFERENTIEL}.dfci_piste p\r\n\t--JOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune c ON p.commune = c.nom\r\n\tJOIN ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune c ON p.numero_insee::text = c.insee\r\nWHERE\r\n\tst_isvalid(p.geometrie)\r\n\tAND st_geometrytype(p.geometrie) = 'ST_LineString'\r\n\tAND NOT st_intersects(p.geometrie,st_buffer(st_setsrid(st_makepoint(959862.39999999863,6262653.7000000002),2154),10))\r\n\tAND NOT st_intersects(p.geometrie,st_buffer(st_setsrid(st_makepoint(982755.42105262703,6260914.5263157887),2154),10))\r\n\r\n) AS troncons_uniques\r\nGROUP BY\r\n\tmot_classant,\r\n\tnom,\r\n\tcommune;\r\n
