126105	66	7096	0	sql	0	SELECT \r\n  CASE WHEN complement = 'NR' THEN '' ELSE complement END as complement,\r\n  annee,\r\n  p.date_modification as date_modification,\r\n  p.date_permis as date_permis,\r\n  CASE WHEN p.nom = 'NR' THEN '' ELSE p.nom END as nom,\r\n  CASE WHEN numero = 'NR' THEN '' ELSE numero END as numero,\r\n  CASE WHEN observations = 'NR' THEN '' ELSE observations END as observations,\r\n  CASE WHEN parcelle_cadastrale = 'NR' THEN '' ELSE parcelle_cadastrale END as parcelle_cadastrale,\r\n  CASE WHEN section_cadastrale = 'NR' THEN '' ELSE section_cadastrale END as section_cadastrale,\r\n  p.version,\r\n  a.nom as avis,\r\n  c.nom as commune,\r\n  u.prenom || ' ' || u.nom as instructeur,\r\n  i.nom as interservice,\r\n  o.nom as service_instructeur,\r\n CASE WHEN voie = 'NR' THEN '' ELSE voie END as voie\r\nFROM \r\n  ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.permis p\r\n  inner join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_permis_avis a on p.avis = a.id\r\n  inner join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.commune c on p.commune = c.id\r\n  inner join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.utilisateur u on p.instructeur = u.id\r\n  inner join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_permis_interservice i on p.interservice = i.id\r\n  inner join ${PDI_POSTGRESQL_NOM_SCHEMA_REMOCRA}.type_organisme o on p.service_instructeur = o.id\r\nwhere ( p.commune = ${COMMUNE_ID} OR ${COMMUNE_ID}  = -1 )\r\n\tAND p.date_permis between ${date_debut_sql} and ${date_fin_sql}\r\n\tAND (p.avis = ${TYPE_PERMIS_AVIS_ID} OR ${TYPE_PERMIS_AVIS_ID} = -1 );
