160105	100	8899	0	class_source	0	import java.io.ByteArrayInputStream;\nimport java.io.FileInputStream;\nimport java.io.IOException;\nimport java.io.InputStream;\nimport javax.xml.transform.stream.StreamSource;\nimport javax.xml.validation.SchemaFactory;\nimport javax.xml.validation.Validator;\nimport org.xml.sax.SAXException;\n\nString xmlFilename;\nValidator validator;\n\npublic boolean processRow(StepMetaInterface smi, StepDataInterface sdi) throws KettleException{\n\n\t//Recup de ligne suivante du flux\n\tObject[] r = getRow();\n\n\t//Si a\taucune ligne\n\tif (r == null) {\n\t\tsetOutputDone();\n\t\treturn false;\n\t}\n\n\t//Si première ligne du flux\n\tif (first) {\n\n\t\ttry {\n\n\t\t//Préparation du validateur à partir de la chaîne XSD\n\t\tString xsdString = get(Fields.In, "xsd").getString(r);\n\t\tInputStream xsdSource = new ByteArrayInputStream(new String(xsdString).getBytes("UTF-8"));\n\t\tSchemaFactory schemaFactory = SchemaFactory.newInstance(javax.xml.XMLConstants.W3C_XML_SCHEMA_NS_URI);\n\t\tvalidator = schemaFactory.newSchema(new StreamSource(xsdSource)).newValidator();\n\n\t\t}catch (Exception e) {\n\n\t\t\tnew KettleException();\n\t\t}\n\n\t    first=false;\n\t}\n\n\t//Ligne de sortie\n    Object[] outputRow = createOutputRow(r, data.outputRowMeta.size());\n\n\ttry{\n\t\t\n\t\t//Récupération du contenu du XML à valider\n\t\txmlFilename = get(Fields.In, "filename").getString(r);\n\t\tInputStream xmlSource = new FileInputStream(xmlFilename);\n\n\t\t//Validation du XML\n\t\tvalidator.validate(new StreamSource(xmlSource));\n\n\t\t//Si AUCUNE erreur de validation, "xml_est_valide" à VRAI\n\t\tget(Fields.Out, "xml_est_valide").setValue(outputRow, true);\n\t\t\t\n\t}catch (Exception e) {\n\n\t\t//Si erreur de validation, "xml_est_valide" à FAUX\n\t\tget(Fields.Out, "xml_est_valide").setValue(outputRow, false);\n\n\t}\n\n\t//Transmission de la ligne au flux\n    putRow(data.outputRowMeta, outputRow);\n\n\treturn true;\n}
